import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
    <label>Choose a browser from this list:
  <input list="browsers" name="myBrowser" /></label>
  <datalist id="browsers">
    <option value="Greg"/>
    <option value="ImposterGreg"/>
    <option value="Internet Explorer"/>
    <option value="Max"/>
    <option value="Sonzi"/>
    <option value="Jack"/>
  </datalist>
    </div>
  );
}

export default App;
